-      emit_insn_before (gen_rtx_SET (VOIDmode,
-				     SET_DEST (PATTERN (p)), const0_rtx),
-			loop_start);
-
-      /* Inside the loop, just load the low part.  */
-      PATTERN (p) = new;
-    }
-}
